import React, { useCallback, useState } from 'react'

import { useQueryClient } from 'react-query'

import { Box, InputAdornment, InputBase, Typography } from '@mui/material'
import { DataGrid } from '@mui/x-data-grid'
import SearchIcon from '@mui/icons-material/Search'
import { Search } from '../../components'

import debounce from 'lodash.debounce'

export default function Tracks () {
  // const queryClient = useQueryClient()
  // const queryName = 'trackData'

  const [search, setSearch] = useState('')

  // const refetch = () => queryClient.invalidateQueries(queryName)
  // const debouncedTrackSearch = useCallback(debounce(refetch, 400), [])
  const handleTrackSearch = (event) => {
    setSearch(event.target.value)
    // debouncedTrackSearch(event.target.value)
  }
  // const data = [
  //   {
  //     id: 10,
  //     title:'blah',
  //     albumId:10,
  //     mediaTypeId:10,
  //     genreId: 10,
  //     composer: 'balh',
  //     duration: 100,
  //     size: 100,
  //     price:10
  //   }
  // ]

  // const columns = [
  //   { field: 'id', hide: true},
  //   {
  //     field: 'title',
  //     headerName: 'Title'
  //   },
  //   { field: 'albumId', hide: true},
  //   { field: 'mediaTypeId', hide: true},
  //   { field: 'genreId', hide: true},
  //   { field: 'composer', hide: true},
  //   {
  //     field: 'duration',
  //     headerName: 'Duration'
  //   },
  //   {
  //     field: 'size',
  //     headerName: 'Size'
  //   },
  //   { field: 'price', hide: true}
  // ]

  const columns = [
    { field: 'id', headerName: 'ID', width: 90 },
    {
      field: 'firstName',
      headerName: 'First name',
      width: 150,
      editable: true,
    },
    {
      field: 'lastName',
      headerName: 'Last name',
      width: 150,
      editable: true,
    },
    {
      field: 'age',
      headerName: 'Age',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'fullName',
      headerName: 'Full name',
      description: 'This column has a value getter and is not sortable.',
      sortable: false,
      width: 160,
      valueGetter: (params) =>
        `${params.row.firstName || ''} ${params.row.lastName || ''}`,
    },
  ];

  const data = [
    { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 },
    { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
    { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
    { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
    { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
    { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
    { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
    { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
    { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
  ];

  return (
    <Box display="flex" flexDirection="column" flexGrow={1}>
      <Box my={2}>
        <Typography variant="h3">Tracks</Typography>
      </Box>
      <Box my={2}>
        <Search
          value={search || ''}
          onChange={handleTrackSearch}
        />
      </Box>
      <DataGrid
        columns={columns}
        rows={data}
        hideFooterRowCount={true}
        disableVirtualization={true}
        density="comfortable"
      />
    </Box>
  )
}
